import Resume from "../images/Resume.jpg";
function WorkHis(props) {
  return (
    <div id="workContainer">
      <h1>Career Goals</h1>
      <p> To be the very best like no one ever was</p>
      <h1>Skills</h1>
      <ul>
        <li>HTML</li>
        <li>CSS</li>
        <li>JavaScript</li>
      </ul>
      <h1>Employment History</h1>
      <p>
        Starbucks Burlington, VT and Boston, MA Aug 2017 – May 2021 World’s
        largest, multinational coffeehouse chain with over 30,000 retail stores
        in 83 markets. Barista, Burlington Aug 2019 – May 2021 Barista, Boston
        Aug 2017 – Jul 2019
      </p>
    </div>
  );
}
export default WorkHis;
